HQ very rare promo music video from a promo DVD. &quot;Get Back&quot; is a song by the Beatles, originally released as a single on 11 April 1969 and credited to &quot;the Beatles with Billy Preston.&quot; A different mix of the song later became the closing track of Let It Be (1970), which was the Beatles' last album released just after the group split. The single version was later issued on CD on the second disc of the Past Masters compilation.

The single reached number one in the United Kingdom, the United States, Ireland, Canada, New Zealand, Australia, France, West Germany, and Mexico. It was the Beatles' only single that credited another artist at their request. &quot;Get Back&quot; was the Beatles' first single release in true stereo in the US. In the UK, the Beatles' singles remained monaural until the following release, &quot;The Ballad of John and Yoko&quot;.

The released version of the song is composed of two verses, with an intro, outro, and several refrains. The first verse tells the story of a man named Jojo, who leaves his home in Tucson, Arizona, for some 'California grass'. McCartney's soon-to-be wife Linda had attended the University of Arizona in Tucson, where the couple later owned a spacious ranch. The second verse is about a sexually ambiguous character named &quot;Loretta Martin&quot;, who &quot;thought she was a woman, but she was another man.&quot; The single version includes a coda urging Loretta to &quot;get back&quot; to where she once belonged.

Billy Preston joined the Beatles on keyboards from 22 January, having been recruited by Harrison partly with a view to deter bickering among the Beatles.

In 1980, Lennon stated that &quot;there's some underlying thing about Yoko in there&quot;, saying that McCartney looked at Yoko Ono in the studio every time he sang &quot;Get back to where you once belonged.&quot;

The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
